import React, { Component } from 'react'
// import logo from "../Constant/logo"

class NavBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const logo = < svg xmlns="http://www.w3.org/2000/svg" width="314" height="404" >
      <path d="M 157.302 29.926 L 157.302 95.75 L 27.949 161.091 L 26.5 292.256 L 26.5 29.926 Z" fill="rgb(255,255,255)" stroke-width="11.21" stroke="rgb(253,254,254)" stroke-miterlimit="10"></path>
      <path d="M 287.5 29.926 L 287.5 161.091 L 157.302 226.553 L 26.5 292.256 L 27.949 161.091 L 157.302 95.75 Z M 157.302 373.926 L 157.302 372.718 L 157.06 242.761 L 157.302 242.882 L 287.5 308.706 Z" fill="rgb(255,255,255)" stroke-width="11.21" stroke="rgb(253,254,254)" stroke-miterlimit="10"></path>
    </svg >
    return (
      <div style={{ backgroundColor: "black" }}>
        <div>
          {logo}
        </div>
      </div>
    );
  }
}

export default NavBar;
